import styled from "styled-components";

const ButtonPrimary = styled.TouchableOpacity`
  height: 40px;
  width: 270px;
  border-radius: 10px;
  display: flex;
  justify-content: center;
  align-items: center;
  margin: 5px 0;
  background-color: ${(props) => props.color.primary};
`;

const ButtonPrimaryTitle = styled.Text`
  color: #fff;
  font-size: 15px;
`;

export { ButtonPrimary, ButtonPrimaryTitle };
